import { createStore, combineReducers } from "redux";
import { reducer as formReducer } from "redux-form";
import {
  changeInputField,
  changePasswordField,
  changeCheckBoxStatus,
  checkFormData
} from "./reducers";

const rootReducer = combineReducers({
  changeInputField,
  changePasswordField,
  changeCheckBoxStatus,
  checkFormData,
  form: formReducer
});

export const store = createStore(rootReducer);
